import React, { Component } from 'react';
import './Email.css'

function Email(props) {
    return (
        <div className="email-container">
            <input
                onChange={props.handleEmail}
                value={props.email}
                placeholder="Email"
                type="Email"
            />
        </div>
    );
}

export default Email;

